import logo from './logo.svg';
import './App.css';
import NavigationSidebar from "./components/NavigationSidebar";
import {Home, Friends, Groups, Events, Favorites} from "./src/components/pages/";
import { BrowserRouter as Router, Rout, Switch } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <NavigationSidebar />
      <Switch>
        <Route exact path="/pages/Friends">
          <Home />
        </Route>
        <Route exact path="/pages/Friends">
          <Friends />
        </Route>
      </Switch>
    </div>
  );
}

export default App;
